import DbIcon from '../../assets/images/db_BI.png';
import React from "react";

const LogoButton = () => {
    const onClickHandler = (e : React.MouseEvent<HTMLElement>) => {
        alert('home');
    }
    return (
        <button onClick={onClickHandler}>
            <img alt={'homeBtn'} src={DbIcon}/>
        </button>
    )
}
export default LogoButton;
